import React from 'react';
import styles from './CohortDetails.module.css';

function CohortDetails(props) {
  const { title, started, status, coach, trainer } = props.cohort;

  return (
    <div className={styles.box}>
      <h3 style={{ color: status.toLowerCase() === "ongoing" ? "green" : "blue" }}>
        {title}
      </h3>
      <dl>
        <dt>Started On</dt>
        <dd>{started}</dd>
        <dt>Current Status</dt>
        <dd>{status}</dd>
        <dt>Coach</dt>
        <dd>{coach}</dd>
        <dt>Trainer</dt>
        <dd>{trainer}</dd>
      </dl>
    </div>
  );
}

export default CohortDetails;
